import React, { Component } from 'react';
import { Link } from 'react-router-dom';
import Header from '../../components/header';
import Footer from '../../components/footer';
import JobGuideCard from '../../components/JobGuideCard';
import Cards from '../../components/Cards';
import Tabs from '../../components/Tabs';
import { withGoogleSheets } from 'react-db-google-sheets';

//Images
import backIcon from '../../assets/images/back-icon.svg';
import notFound from '../../assets/images/not-found.svg';

// Style
import './styles.scss';

const tabsData = ['All', 'Full Time', 'Internship', 'Freelance'];

class PrivacyPolicy extends Component {
  render() {
    return (
      <div className='city-jobs-page-style' ref={this.myRef}>
        <div class='all-page-style'>
          <div class='header-banner-style'>
            <Header />

            <div className='text-box'>
              <h5 className='title'>Privacy Policy</h5>
              <p className='sub-title'>Last updated on Monday, 16 November</p>
            </div>

            <div className='text-box'>
              <h5 className='heading'>1. Introduction</h5>
              <p className='post-info-para'>
                These Privacy Policy (“Privacy Policy”) apply to the use of the
                website and products provided by (hereinafter also referred as
                “we” or “us”). Our registered office is at Gurgaon, Haryana,
                registered no.: 8607901606.
              </p>

              <p className='post-info-para'>
                This Privacy Policy applies and has effect in respect of all
                services and other products, software, made available by us, as
                well as any other online features relating to the website and
                its content (the “Service(s)”).
              </p>

              <p className='post-info-para'>
                If you have any questions or comments about this Privacy Policy,
                please contact us at{' '}
                <a href='mailto:rohanmishra.design@gmail.com'>
                  rohanmishra.design@gmail.com
                </a>
                .
              </p>
            </div>

            <div className='text-box'>
              <h5 className='post-heading'>Privacy Policy</h5>
              <p className='post-info-para'>
                Last updated on Monday, 16 November
              </p>
            </div>
          </div>

          <p className='job-guide-para text-center top-space'>
            Building an extensive knowledge base to help to make the most out of
            opportunities. <span className='coming-soon'>Coming Soon 😉</span>
          </p>

          <Footer />
        </div>
      </div>
    );
  }
}

export default PrivacyPolicy;
